    public class TheFullCountingSort
    {
        static void countSort(List<List<string>> arr)
        {
            var sortedArr = arr.Select((x,i)=>new { Index = i , GivenIndex = x.FirstOrDefault(),Str=x.Skip(1).FirstOrDefault() }).OrderBy(x => x.GivenIndex);
            foreach(var item in sortedArr)
            {
                if (item.Index < arr.Count() / 2)
                {
                    Console.Write("- ");
                }
                else
                {
                    Console.Write($"{item.Str} ");
                }
            }
            Console.WriteLine();
            Console.WriteLine(arr.Count() / 2);
        }

